import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { motion } from 'framer-motion';
import './css/CodingWork.css';
import backgroundImage from '../assets/3d-render-boy-with-orange-tshirt-sunglasses.jpg'; // Adjust path accordingly

const CodingWork = () => {
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/projects')
      .then(response => setProjects(response.data))
      .catch(error => console.error('Error fetching projects:', error));
  }, []);

  return (
    <div>
      <h2>Coding Work</h2>
      <div className="project-list">
        {projects.map(project => (
          <motion.div 
            key={project._id} 
            className="project"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
          >
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            {project.githubLink && <p className="github-link"><a href={project.githubLink}>GitHub Repo</a></p>}
            {project.backgroundImage && <div className="background-image"><img src={project.backgroundImage} alt="Background" /></div>}
          </motion.div>
        ))}
      </div>
      <div className="footer">
        Â© 2024 Jayesh Ranjan Kesari. All rights reserved.
      </div>
    </div>
  );
};

export default CodingWork;
